				viewBox = "0 0 24 24";
			}


			var svgHtml = $"<svg xmlns='http://www.w3.org/2000/svg' fill='currentColor' viewBox='{viewBox}'>";
			if (_iconTypeSvgDict.ContainsKey(type))
				svgHtml += _iconTypeSvgDict[type];
			svgHtml += "</svg>";
			return svgHtml;
		}

