		private static void InitIconTypeDescriptionEnumDict()
		{

			_iconDecriptionTypeEnumDict = new Dictionary<string, WvIconType>();
			_iconTypeEnumDecriptionDict = new Dictionary<WvIconType, string>();
			var values = Enum.GetValues(typeof(WvIconType)).Cast<WvIconType>();

			foreach (var value in values)
			{
				_iconDecriptionTypeEnumDict[value.ToDescriptionString()] = value;
				_iconTypeEnumDecriptionDict[value] = value.ToDescriptionString();
			}
		}

		public static Dictionary<string, WvIconType> GetIconTypeDescriptionEnumDict()
		{
			if (_iconDecriptionTypeEnumDict != null)
				return _iconDecriptionTypeEnumDict;
			else
				return new Dictionary<string, WvIconType>();
		}

		public static WvIconType? GetIconTypeByDescription(string description)
		{
			if (_iconDecriptionTypeEnumDict.ContainsKey(description))
				return _iconDecriptionTypeEnumDict[description];

			return null;
		}

		public static string GetDescriptionByIconType(WvIconType type)
		{
			if (_iconTypeEnumDecriptionDict.ContainsKey(type))
				return _iconTypeEnumDecriptionDict[type];

			return null;
		}
	}
